            if (i == EditorInfo.IME_ACTION_DONE) {
                String nodeName = mNodeNameEditText.getText().toString().trim();
                if (!nodeName.isEmpty()) {
                    retrieveData(nodeName); // Retrieve data for entered node name
                } else {
